import React from 'react';
import '../../style/Profile.css';

function Profile() {

    let wordSet1 = {
        words: [
            {
                id: 1,
                part1: 'cat',
                part2: 'кошка',
                isLernt: false,
                lastSeen: '03.01.2022' // dd.mm.yyyy
            },
            {
                id: 2,
                part1: 'bog',
                part2: ' собака',
                isLernt: true,
                lastSeen: '01.01.2022' // dd.mm.yyyy
            }
        ],
        name: 'Domestic Animals', 
        description: 'Names of some most popular animals.'
    };
    let wordSet2 = {
        words: [
            {
                id: 1,
                part1: 'Take into consideration',
                part2: 'принимать во внимание, принимать к сведению',
                isLernt: false,
                lastSeen: '03.01.2022' // dd.mm.yyyy
            },
            {
                id: 2,
                part1: 'Once in a blue moon',
                part2: 'Очень редко, почти никогда',
                isLernt: true,
                lastSeen: '01.01.2022' // dd.mm.yyyy
            },
            {
                id: 3,
                part1: 'Have butterflies in your stomach',
                part2: 'Быть очень взволнованным, нервным',
                isLernt: true,
                lastSeen: '01.01.2022' // dd.mm.yyyy
            },
            {
                id: 4,
                part1: 'See eye to eye',
                part2: 'Быть согласным, иметь такую же точку зрения',
                isLernt: true,
                lastSeen: '01.01.2022' // dd.mm.yyyy
            }
        ],
        name: 'Phrasav verbes', 
        description: 'Some most popular English ideoms.'
    };

    return (
        <div>
            <h2>My profile</h2>
            <h2>My study sets:</h2>
        </div>
    )
}

export default Profile;
